import React, { Component } from "react";
import logo from "./logo.svg";
import fontenay from "./fontenay.jpg";
import koh from "./koh.jpg";
import RuPauls from "./RuPauls.jpg";
import "./App.css";

class App extends Component {
  constructor(props) {
    super(props);

    this.state = {
      transitValue: "imageEntre",
      transit2: null,
    };
  }

  render() {
    return (
      <div>
        {transit2 == null && (
          <img
            onMouseEnter={transite3}
            src={RuPauls}
            className={
              transitValue == "imageEntre" ? "imageEntre" : "transit imageEntre"
            }
            alt="RuPauls"
          />
        )}
        {console.log("transit2 ::", transitValue)}
        <img
          onMouseEnter={transite3}
          src={fontenay}
          className={this.state.transitValue}
          alt="fontenay"
        />
        <img
          onMouseEnter={transite3}
          src={koh}
          className={transitValue}
          alt="denis"
        />
      </div>
    );
  }
}

function transite3() {
  console.log("oui AVANT::", transitValue);
  transitValue = "transit";
  console.log("oui ::", transitValue);
  transit2 = "transit imageEntre";
  return;
}
export default App;
